import { useLocation } from "react-router-dom";
import DB  from "../Data/DataBase.json"

function PostPage() 
{
    var [look,look_] = useState(useLocation().pathname.substring(6));
    return(
        <div>
            <div>제목::{DB.PostList[look].Title}</div>
            <div>내용::{DB.PostList[look].Title}</div>
            <button onClick={ButtonAc}></button>
        </div>
    );  
}

export default PostPage;
